import { Label, LabelText, Button } from "govuk-react";
import { useNavigate } from "react-router-dom";
function Surname() {
  return (
    <div>
      <Label className="govuk-label govuk-label--1">
        <h1>
          <LabelText>What is your surname?</LabelText>
        </h1>
        <Input />
      </Label>
      <Button onClick={() => navigate("/InputLabel")} start>
        Save and Continue
      </Button>
    </div>
  );
}
export default Surname;
